import ExpenseItem from "./ExpenseItem";
import './Expenses.css'

function Expenses(props) {
    const ExpenseItemElements = props.items.map((expenses) => {
        return (
            <ExpenseItem
                title={expenses.title}
                amount={expenses.amount}
                date={expenses.date}
            />
        )
    })

    return (
        <div className="expenses">
            <ExpenseItemElements />
        </div>
    )
}

export default Expenses;
